description:
Albums: The Greatest Band of All Time &amp; The Ballsy EP.

The band combines a militaristic appearance with a musical style rooted in skate punk and heavy metal. Describing their music as Action Adventure Hardcore Rock and Roll, the focus of the band is on energetic live performances which feature interaction with the audience. Attendees and fans are referred to by the band as \&quot;Goddamn Heroes.\&quot;

ArnoCorps is the world\'s first band to feature lyrics based exclusively on the films of Arnold Schwarzenegger, with particular emphasis on his action roles from the 1980s such as The Terminator, Predator and Total Recall, with many of the lyrics paralleling movie dialogue and plots, similar to The Misfits\' lyrical focus on horror films and B-movies.
